// SPDX-License-Identifier: MIT
pragma solidity =0.7.6;
pragma abicoder v2;

import "./interfaces/IBEP20.sol";
import "./interfaces/ITokenChopToken.sol";
import "./interfaces/IStdReference.sol";
import "./libs/SafeMath.sol";
import "./libs/Math.sol";

contract TokenChopToken is IBEP20, ITokenChopToken {
    using SafeMath for uint256;
    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private _totalSupply;
    uint256 private _collateral;
    address private _factory;
    string private _name;
    string private _symbol;
    string private _type;
    uint256 private _price;
    string private _baseSymbol;
    string private _quoteSymbol;
    address private _base;
    address private _quote;

    address private _sister;
    address private constant _bandProtocol = 0xDA7a001b254CD22e46d3eAB04d937489c93174C3;

    event CollateralTransfer(address indexed from, address indexed to, uint256 value);

    constructor() {
        _factory = msg.sender;
    }

    function initialize(int8 typeId, address base, address quote, address sister) external override {
        require(msg.sender == _factory, 'TokenChop: FORBIDDEN');
        _type = typeId == 0 ? "Stable" : "Spec";
        _base = base;
        _quote = quote;
        _sister = sister;
        IBEP20 baseContract = IBEP20(_base);
        IBEP20 quoteContract = IBEP20(_quote);
        _name = string(abi.encodePacked(bytes("TokenChop: "), bytes(baseContract.symbol()), bytes("/"), bytes(quoteContract.symbol()), bytes(" "), bytes(_type)));
        _symbol = string(abi.encodePacked(bytes(baseContract.symbol()), bytes(quoteContract.symbol()), bytes(typeId == 0 ? '0' : '1')));
    }

    function collateral() external view returns (uint256) {
        return _collateral;
    }

    function name() external override view returns (string memory) {
        return _name;
    }

    function symbol() external override view returns (string memory) {
        return _symbol;
    }

    function getOwner() external override view returns (address) {
        return _factory;
    }

    function decimals() external override pure returns (uint8) {
        return 18;
    }

    function totalSupply() external override view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address _account) external override view returns (uint256) {
        return _balances[_account];
    }

    function transfer(address _recipient, uint256 _amount) external override returns (bool) {
        _transfer(msg.sender, _recipient, _amount);
        return true;
    }

    function allowance(address _owner, address _spender) external override view returns (uint256) {
        return _allowances[_owner][_spender];
    }

    function approve(address _spender, uint256 _amount) external override returns (bool) {
        _approve(msg.sender, _spender, _amount);
        return true;
    }

    function transferFrom(address _sender, address _recipient, uint256 _amount) external override returns (bool) {
        _transfer(_sender, _recipient, _amount);
        require(_allowances[_sender][msg.sender] >= _amount, "BEP20: transfer amount exceeds allowance");
        _approve(_sender, msg.sender, _allowances[_sender][msg.sender] - _amount);
        return true;
    }

    function _transfer(address _sender, address _recipient, uint256 _amount) internal {
        require(_sender != address(0), "BEP20: transfer from the zero address");
        require(_recipient != address(0), "BEP20: transfer to the zero address");
        require(_balances[_sender] >= _amount, "BEP20: transfer amount exceeds balance");
        
        _balances[_sender] = _balances[_sender].sub(_amount);
        _balances[_recipient] = _balances[_recipient].add(_amount);

        emit Transfer(_sender, _recipient, _amount);
    }

    function _approve(address _owner, address _spender, uint256 _amount) internal {
        require(_owner != address(0), "BEP20: approve from the zero address");
        require(_spender != address(0), "BEP20: approve to the zero address");

        _allowances[_owner][_spender] = _amount;
        emit Approval(_owner, _spender, _amount);
    }

    function updatePrice() public returns (bool) {
        IStdReference bandProtocolContract = IStdReference(_bandProtocol);
        IStdReference.ReferenceData memory data = bandProtocolContract.getReferenceData(_baseSymbol,_quoteSymbol);
        uint256 newPrice = data.rate;
        if (_price == newPrice) {
            return true;
        }
        uint256 newCollateral = Math.mulDiv(_price, newPrice, _collateral);
        bool result = rebalanceCollateral(newCollateral);
        _price = newPrice;
        return true;
    }

    function rebalanceCollateral(uint256 newCollateral) public returns (bool) {
        if (newCollateral > _collateral) {
            uint256 amount = newCollateral.sub(_collateral);
            uint obtained = getCollateralFromSister(amount);
        } else {
            uint256 amount = _collateral.sub(newCollateral);
            uint sent = sendCollateralToSister(amount);
        }
        return true;
    }

    function getCollateralFromSister(uint256 _amount) internal returns (uint) {
        TokenChopToken sister = TokenChopToken(_sister);
        uint received = sister.sendCollateralToSister(_amount);
        _collateral = _collateral.add(received);
        return received;
    }

    function sendCollateralToSister(uint256 _requestedAmount) public returns (uint256 amount) {
        uint _amount = _collateral < _requestedAmount ? _collateral : _requestedAmount;
        IBEP20 baseContract = IBEP20(_base);
        bool success = baseContract.transfer(_sister, _amount);
        if (success) {
            _collateral = _collateral.sub(_amount);
        }
        uint _sentAmount = success ? _amount : 0;
        emit CollateralTransfer(address(this), _sister, _sentAmount);
        return _sentAmount;
    }

    function mint(uint256 _collateralAmount) public returns (bool) {
        IBEP20 baseContract = IBEP20(_base);
        bool result = baseContract.transferFrom(msg.sender, address(this), _collateralAmount); //try a transfer from
        require(result, "Failed to transfer token. Transfer must be approved first");
        bool updatePriceDone = updatePrice();
        // value of amount in tokens is _totalSupply/_collateral
        uint256 _tokenAmount = Math.mulDiv(_totalSupply, _collateral, _collateralAmount);
        _balances[msg.sender] = _balances[msg.sender].add(_tokenAmount);
        _totalSupply = _totalSupply.add(_tokenAmount);
        emit Transfer(address(0), msg.sender, _tokenAmount);
        emit CollateralTransfer(msg.sender, address(this), _collateralAmount);
        return true;
    }

    function burn(uint256 _tokenAmount) public returns (bool) {
        require(_tokenAmount <= _balances[msg.sender]);
        _balances[msg.sender] = _balances[msg.sender].sub(_tokenAmount);
        bool updatePriceDone = updatePrice();
        // amount to return is colat*tokens/totalsupply
        uint256 _collateralAmount = Math.mulDiv(_collateral, _tokenAmount, _totalSupply);
        _collateral = _collateral.sub(_collateralAmount);
        emit Transfer(msg.sender, address(0), _tokenAmount);
        emit CollateralTransfer(address(this), msg.sender, _collateralAmount);        
        IBEP20 baseContract = IBEP20(_base);
        return baseContract.transfer(msg.sender, _collateralAmount);
    }

}
